import React from "react";
import "./ControlPins.css";

class ReadValue extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      valRead: {
        PD4: "",
        PD5: "",
        PD6: "",
        PA1: "",
        PA2: "",
        PA3: "",
        PD3: "",
        PD2: "",
